    TempDict = {}
    for ele in OriLayerGSEAData:
        TempDict[ele] = abs(OriLayerGSEAData[ele])
    print("取完绝对值之后的数据是谁！", TempDict)
    Value = OriLayerGSEAData.values()
    print("那么这个值的最大值与最小值是谁！", np.min(Value), np.max(Value))


    ### 这个表示是否对字典中的各个value取绝对值！
    def OriGSEADataProcess_Abs(OriLayerGSEAData):
        ### 首先，先来看看是否对其中的Value值取绝对值操作！    在这，这个LayerGSEAData、OriLayerGSEAData跟上面的那个数据并不一样，他这个是有新的含义的！
        LayerGSEAData = []
        for data in OriLayerGSEAData:  ### 这个是一层网络一层网路的来取！
            TempDict = {}
            for ele in data:
                TempDict[ele] = abs(data[ele])
            LayerGSEAData.append(TempDict)  ### 再一层一层的加进去！
        return LayerGSEAData

    ### 这个主要是对传入的GSEA分数值（在这其实就是原始的GSEA分数）进行归一化操作，指定最终归一化到的范围
    def OriGSEADataProcess_Normilse(Data):
        MIN, MAX = 0, 1  ### 这个表示当前这个数据应该归一化什么范围
        for data in Data:  ### 逐层网络的进行抽取！
            ### 下面这个是要一层一层的分开来进行归一化！      是要来挑选出属于这一层的最大最小值！来进行属于这一层的归一化操作！
            Value = list(data.values())
            d_min = min(Value)  # 当前数据最大值
            d_max = max(Value)  # 当前数据最小值
            for ele in data:  ### 抽取当前网络层中的各个元素！
                data[ele] = MIN + ((MAX - MIN) / (d_max - d_min)) * (data[ele] - d_min)  ### 逐个元素的进行归一化到指定的范围内！
        return Data

    OriData = [{'a': 1.003, 'b': -3.99887676, 'c': -1.987}, {'a': 9.5571, 'b': -7.547861, 'c': -1.987}]
    # ### 测试绝对值！
