    ### 下面这个函数主要是来获取各个神经元是否进行消融的分数！如果这个神经元要进行消融，那么他的分数就是0，否则就是1
    def GetXiaoRongScore():
        ### 下面这个就是用可解释性算法求得的各层神经元的重要性分数所保存的文件路径！
        ExplainScoreFilePath = './ZhongJianResult/FinallSave/DeepExplainTwo_Sort/FinallSave-23.4.11-'
        BiLi = 0.1  ### 这个是决定当前要消掉百分之多少的神经元！
        FinalExplainScore = []
        for i in range(len(OriLayerGSEAData)):
            Elements = OriLayerGSEAData[i]  ### 读取第i层神经网络中的各个具体的元素！
            data = pd.read_csv(ExplainScoreFilePath + str(i) + '.csv')  # 读取文件中所有数据
            ExplainScore = np.array(data[['elementName']])  # 读取具体的分数元素名字那一列（现在各个元素已经按照1重要性得分排过序了，直接读进来就行！！）
            print("当前读取的数组是谁！", ExplainScore)
            Num = int(len(ExplainScore) * BiLi)
            XiaoRongEle = ExplainScore[0:Num]  ### 现在这个数据就是当前这一网络层要消融掉的元素都有哪些
            print("当前的这个元素都有谁！", XiaoRongEle)
            for ele in Elements:
                if ele in XiaoRongEle:
                    Elements[ele] = 0
                else:
                    Elements[ele] = 1
            FinalExplainScore.append(Elements)
        return FinalExplainScore
    print("那么最终的这个消融分数是谁呢！？？", GetXiaoRongScore())

